INSERT INTO `product` (`id`, `id_group_bmi`, `id_company`, `name`, `product_code`, `run_quote`, `sort_by`, `agent_guide`, `application_url`, `product_video`, `require_eo`, `sales_training_video`, `description`, `gender`, `create_date`, `created_at`, `updated_at`) VALUES
(1, NULL, 18, 'Simple Term 20 Dlx', 'FA189', 'http://www.unitedhomelife.com/UnitedHomeLife/QuickQuote.jsp', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', '', NULL, '', '<p><strong>Simple Term 20 Deluxe</strong><br />\r\n<em>20-Year Simplified Issue (up to Table 8)</em><br />\r\n<br />\r\n<strong>Term Issue Ages:</strong>&nbsp;Non-Tobacco: 20 &ndash; 60 (age last birthday)<br />\r\n<strong>Tobacco:</strong>&nbsp;20 &ndash; 40 (age last birthday)<br />\r\n<br />\r\n<strong>Face Amounts:</strong><br />\r\nMinimum: $25,000<br />\r\nMaximums:</p>\r\n\r\n<ul>\r\n	<li>$50,000 (age 20-60)&nbsp;</li>\r\n</ul>\r\n\r\n<p>Simple Term 20 Deluxe offers&nbsp;guaranteed level premiums for the initial term period (after which premiums increase annually), and guaranteed renewability to age 95.<br />\r\n<br />\r\n<strong>Benefits/Riders:&nbsp;</strong><br />\r\n<strong>Simple Term 20 Deluxe</strong>:<br />\r\n<em>Simplified Issue Term Up To Table 8</em></p>\r\n\r\n<ul>\r\n	<li><strong>Child Rider:</strong>&nbsp;provides coverage for children issue ages 30 days &ndash; 18 years (age last). Sold in units of $5,000 (max is 4 units); premium is $25 per unit. Child must be insurable. Separate application required. Fully convertible prior to child&rsquo;s attained age 21 (or date rider terminates, if earlier) without evidence of insurability. Child Rider can be added to a grandparent&rsquo;s base policy only if the child has been legally adopted by the grandparent. Rider terminates if requested in writing, the date the policy is continued under a non-forfeiture option, if the policy is at the end of its premium paying period, or on the anniversary at the insured&rsquo;s attained age 65. While the rider is in force, insurance on any child terminates on the child&rsquo;s 21st birthday.* First $5,000 of Child Rider coverage is at no charge for base policy face amounts of $100,000 or more.&nbsp;</li>\r\n	<li><strong>No-Cost Terminal Illness Accelerated Death Benefit:&nbsp;</strong>provides the policyowner with the right to access the policy&rsquo;s death benefit (discounted at interest for one year) on the life of the Insured if the Insured is diagnosed with a life expectancy of 12 months or less.*</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>For all simplified-issue term products, a Personal History Interview (PHI) is required.&nbsp;</strong><br />\r\n<br />\r\n<strong>Know Before You Go&reg; Application Process:</strong>&nbsp;<br />\r\n&bull; Let your client know what to expect:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Purpose: to review information on application.&nbsp;</li>\r\n	<li>Typically takes 6-12 minutes, depending on product.&nbsp;</li>\r\n	<li>Discussion includes medical history, name of physician, and other pertinent information from app.&nbsp;</li>\r\n	<li>Remind client to be forthcoming and honest in answering interviewer questions.</li>\r\n</ul>\r\n\r\n<p>&bull; You, as the agent, initiate a Personal History Interview (PHI) from your client&rsquo;s home by calling 866-333-6557.&nbsp;<br />\r\n&bull; Tell the operator the interview is for UHL/UFFL and for the appropriate simplified issue term product (Simple Term 20/30/ROP or Simple Term 20 Deluxe).&nbsp;<br />\r\n&bull; Hand the phone to your client, who must complete the interview without coaching or help from others.&nbsp;<br />\r\n&bull; During the call, the interviewer conducts MIB and IntelliScript prescription drug history searches.&nbsp;<br />\r\n&bull; When the client is finished with the interview, he/she will be asked to hand the phone back to you.&nbsp;<br />\r\n&bull; Based on the client&rsquo;s answers to the questions, and the MIB and prescription drug database searches, the interviewer will tell you whether or not the application should be submitted to the Home Office.&nbsp;<br />\r\n<br />\r\n<strong>PHI Hours:</strong>&nbsp;&bull; 8:30 a.m. - 11:30 p.m. Monday - Friday; 11:00 a.m. to 5:00 p.m. Eastern on Saturday. Sundays by appointment.&nbsp;<br />\r\n&bull; If agent did not meet with the applicant in person when the application was taken, a PHI is&nbsp;<strong>REQUIRED</strong>.&nbsp;<br />\r\n&bull; If the PHI is not done at the time the application is taken, the Home Office will order it.</p>', 'All', NULL, '2022-10-07 11:57:14', '2022-11-17 06:58:30'),
(2, NULL, 18, 'Simple Term 20/30/ROP', '70D19', 'http://www.unitedhomelife.com/UnitedHomeLife/QuickQuote.jsp', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', '', NULL, '', '<p><strong>Simple Term 20/30/ROP</strong><br />\r\n<em>20-Year Simplified Issue</em><br />\r\n<em>30-Year Simplified Issue</em>&nbsp;<br />\r\n<br />\r\n<strong>Term Issue Ages:</strong>&nbsp;20 &ndash; 60 (age last birthday)<br />\r\n<br />\r\n<strong>Face Amounts:</strong><br />\r\nMinimum: $25,000<br />\r\nMaximums:</p>\r\n\r\n<ul>\r\n	<li>$200,000 (through age 45)&nbsp;</li>\r\n	<li>$150,000 (ages 46 &ndash; 55)&nbsp;</li>\r\n	<li>$100,000 (ages 56 &ndash; 60)</li>\r\n</ul>\r\n\r\n<p>Simple Term 20 &amp; 30&nbsp;offers guaranteed level premiums for the initial term period (after which premiums increase annually), and guaranteed renewability to age 95.<br />\r\n<br />\r\n<strong>Benefits/Riders:</strong><br />\r\n<strong>Simple Term 20/30/ROP:</strong><br />\r\n<em>Simplified Issue Term</em></p>\r\n\r\n<ul>\r\n	<li><strong>Total And Permanent Disability Benefit (Waiver Of Premium):</strong>&nbsp;premiums waived during total and permanent disability up to the policy anniversary nearest the Insured&rsquo;s 60th birthday. See page 10 for rates per thousand. Rider terminates if requested in writing, on the date the policy is continued under a non-forfeiture option, or on the policy anniversary nearest the Insured&rsquo;s attained age 60.*&nbsp;</li>\r\n	<li><strong>Child Rider:</strong>&nbsp;provides coverage for children issue ages 30 days &ndash; 18 years (age last). Sold in units of $5,000 (max 4 units); premium is $25 per unit. Child must be insurable. Separate application required. Fully convertible prior to child&rsquo;s attained age 21 (or date rider terminates, if earlier) without evidence of insurability. Child Rider can be added to a grandparent&rsquo;s base policy only if the child has been legally adopted by the grandparent. Rider terminates if requested in writing, the date the policy is continued under a nonforfeiture option, if the policy is at the end of its premium paying period, or on the anniversary at the insured&rsquo;s attained age 65. While the rider is in force, insurance on any child terminates on the child&rsquo;s 21st birthday.* First $5,000 of Child Rider coverage is at no charge for base policy face amounts of $100,000 or more.&nbsp;</li>\r\n	<li><strong>Accidental Death Benefit Rider:</strong>&nbsp;provides a benefit in addition to the base policy benefit should the insured die by accidental bodily injury independent of all other causes, provided death occurs within 90 days of such injury. Not covered: war or any act attributable to war; riot participation; suicide; bodily or mental infirmity of any kind; committing or attempting to commit an assault or a felony; voluntary ingestion of poison, drug or sedative or asphyxiation from inhalation of gas; while being transported on any kind of aircraft unless solely as a passenger without any duties whatsoever. See page 10 for rates per thousand. Rider terminates at the earliest of the policy anniversary nearest the Insured&rsquo;s 70th birthday, the date the policy is continued under a non-forfeiture option, or if requested in writing. Minimum face amount for base policy and ADB rider is $25,000 each. Max ADB rider is base policy face amount.*&nbsp;</li>\r\n	<li><strong>No-Cost Terminal Illness Accelerated Death Benefit:</strong>&nbsp;provides the policy owner with the right to access the policy&rsquo;s death benefit (discounted at interest for one year) on the life of the Insured if the Insured is diagnosed with a life expectancy of 12 months or less.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>For all simplified-issue term products, a Personal History Interview (PHI) is required.</strong><br />\r\n<br />\r\n<strong>Know Before You Go&reg; Application Process:</strong><br />\r\n&bull; Let your client know what to expect:</p>\r\n\r\n<ul>\r\n	<li>Purpose: to review information on application.&nbsp;</li>\r\n	<li>Typically takes 6-12 minutes, depending on product.&nbsp;</li>\r\n	<li>Discussion includes medical history, name of physician, and other pertinent information from app.&nbsp;</li>\r\n	<li>Remind client to be forthcoming and honest in answering interviewer questions.</li>\r\n</ul>\r\n\r\n<p>&bull; You, as the agent, initiate a Personal History Interview (PHI) from your client&rsquo;s home by calling 866-333-6557.<br />\r\n&bull; Tell the operator the interview is for UHL/UFFL and for the appropriate simplified issue term product (Express Issue Term 20, Express Issue Term 30, or Premier 20 Return-of-Premium Term).<br />\r\n&bull; Hand the phone to your client, who must complete the interview without coaching or help from others.<br />\r\n&bull; During the call, the interviewer conducts MIB and IntelliScript prescription drug history searches.<br />\r\n&bull; When the client is finished with the interview, he/she will be asked to hand the phone back to you.<br />\r\n&bull; Based on the client&rsquo;s answers to the questions, and the MIB and prescription drug database searches, the interviewer will tell you whether or not the application should be submitted to the Home Office.<br />\r\n<br />\r\n<strong>PHI Hours:</strong>&nbsp;&bull; 8:30 a.m. - 11:30 p.m. Monday - Friday; 11:00 a.m. to 5:00 p.m. Eastern on Saturday. Sundays by appointment.<br />\r\n&bull; If agent did not meet with the applicant in person when the application was taken, a PHI is&nbsp;<strong>REQUIRED</strong>.<br />\r\n&bull; If the PHI is not done at the time the application is taken, the Home Office will order it.</p>', 'All', NULL, '2022-10-10 08:18:01', '2022-11-15 08:00:29'),
(3, NULL, 18, 'Express Issue Whole Life', 'AF83D', 'http://www.unitedhomelife.com/UnitedHomeLife/mobile/mobileEIWLBasicQuote.do', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', '', NULL, '', '<p><strong>Express Issue Whole Life</strong><br />\r\n<em>Simplified Issue</em><br />\r\n<br />\r\nGraded Benefit Issue Ages: 25 &ndash; 80 (age last birthday)<br />\r\nFace Amounts: $2,000 &ndash; 25,000<br />\r\n<br />\r\nGraded Death Benefit During First Two Policy Years:<br />\r\n&bull; Year 1: benefit payable equals refund of premium plus 12% interest.&nbsp;<br />\r\n&bull; Year 2: benefit payable equals refund of premium plus 24% interest.&nbsp;<br />\r\n<br />\r\nFull death benefit payable if death occurs due to accidental causes in the first two policy years<br />\r\n<br />\r\n<strong>Know Before You Go&reg; Application Process:&nbsp;</strong><br />\r\n&bull; Let your client know what to expect:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Purpose: to review information on application.&nbsp;</li>\r\n	<li>Typically takes 6-12 minutes, depending on product.&nbsp;</li>\r\n	<li>Discussion includes medical history, name of physician, and other pertinent information from app.&nbsp;</li>\r\n	<li>Remind client to be forthcoming and honest in answering interviewer questions.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&bull; &nbsp;You, as the agent, initiate a Personal History Interview (PHI) from your client&rsquo;s home by calling 866-333-6557.&nbsp;<br />\r\n&bull; Tell the operator the interview is for UHL/UFFL and for the appropriate simplified issue whole life product (Express Issue Whole Life, Express Issue Deluxe, Express Issue Premier, or Provider).&nbsp;<br />\r\n&bull; Hand the phone to your client, who must complete the interview without coaching or help from others.&nbsp;<br />\r\n&bull; During the call, the interviewer conducts MIB and IntelliScript prescription drug history searches.&nbsp;<br />\r\n&bull; When the client is finished with the interview, he/she will be asked to ha