-Friday;&nbsp;11:00 a.m. to 5:00 p.m. Eastern on Saturday. Sundays by appointment.&nbsp;<br />\r\n&bull; If agent did not meet with the applicant in person when the application was taken, a PHI is REQUIRED.&nbsp;<br />\r\n&bull; If the PHI is not done at the time the application is taken, the Home Office will order it.<br />\r\n<br />\r\n<br />\r\n&nbsp;</p>', 'All', NULL, '2022-10-10 09:43:41', '2022-11-15 08:01:54'),
(5, NULL, 18, 'Express Issue - Premier', '4C3F2', 'http://www.unitedhomelife.com/UnitedHomeLife/mobile/mobileEIWLPremierQuote.do', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', '', NULL, '', '<p><strong>Express Issue Premier</strong><br />\r\n<em>Simplified Issue Whole Life</em><br />\r\n<br />\r\nIssue Ages: 20 - 80 (age last birthday)<br />\r\nFace Amounts: $5,000 - 100,000 (through age 60)<br />\r\n$5,000 - 50,000 (ages 61-80)<br />\r\n<br />\r\n<strong>Know Before You Go&reg; Application Process:</strong><br />\r\n&bull; Let your client know what to expect:</p>\r\n\r\n<ul>\r\n	<li>Purpose: to review information on application.&nbsp;</li>\r\n	<li>Typically takes 6-12 minutes, depending on product.&nbsp;</li>\r\n	<li>Discussion includes medical history, name of physician, and other pertinent information from app.&nbsp;</li>\r\n	<li>Remind client to be forthcoming and honest in answering interviewer questions.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&bull; &nbsp;You, as the agent, initiate a Personal History Interview (PHI) from your client&rsquo;s home by calling 866-333-6557.<br />\r\n&bull; Tell the operator the interview is for UHL/UFFL and for the appropriate simplified issue whole life product (Express Issue Whole Life, Express Issue Deluxe, Express Issue Premier, or Provider).<br />\r\n&bull; Hand the phone to your client, who must complete the interview without coaching or help from others.<br />\r\n&bull; During the call, the interviewer conducts MIB and IntelliScript prescription drug history searches.<br />\r\n&bull; When the client is finished with the interview, he/she will be asked to hand the phone back to you.<br />\r\n&bull; Based on the client&rsquo;s answers to the questions, and the MIB and prescription drug database searches, the interviewer will tell you whether or not the application should be submitted to the Home Office.<br />\r\n<br />\r\n<strong>PHI Hours:</strong><br />\r\n&bull;&nbsp;8:30 a.m. &ndash; 11:30 p.m., Monday-Friday;&nbsp;11:00 a.m. to 5:00 p.m. Eastern on Saturday. Sundays by appointment.<br />\r\n&bull; If agent did not meet with the applicant in person when the application was taken, a PHI is REQUIRED.<br />\r\n&bull; If the PHI is not done at the time the application is taken, the Home Office will order it.</p>', 'All', NULL, '2022-10-10 09:45:47', '2022-11-15 08:03:23'),
(6, NULL, 4, 'Trendsetter LB/Super', 'CD35E', 'https://m.lifesales.transamerica.com/RunAQuote.aspx', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', 'https://www.youtube.com/watch?v=JD_w7c2NmLQ', NULL, 'http://www.sfglife.com/sales-training?wvideo=gj4s0zkzar', '<p>Transamerica&rsquo;s Trendsetter&reg; Series consists of Trendsetter Super and Trendsetter LB (living benefits). It&rsquo;s a portfolio of guaranteed initial level premium term life insurance products that combine the benefits of term life insurance with a range of options to meet a variety of client needs.<br />\r\n<br />\r\n<strong>The Trendsetter Series helps to provide protection, value, and convenience with these additional advantages:</strong></p>\r\n\r\n<ul>\r\n	<li>High issue ages.</li>\r\n	<li>Low face amounts.&nbsp;</li>\r\n	<li>Competitive premiums.&nbsp;</li>\r\n	<li>Non-med underwriting options.&nbsp;</li>\r\n	<li>A range of endorsements and riders for additional policy personalization.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>Face Amounts:</strong><br />\r\nNon-med: $25,000 - $249,999<br />\r\nFully Underwritten: $250,000 - $2,000,000<br />\r\n<br />\r\n<strong>Product Riders:</strong></p>\r\n\r\n<ul>\r\n	<li>Monthly Disability - $300 up to the lesser of $2,000/mo or 2% of base policy</li>\r\n	<li>Disability Waiver of Premium</li>\r\n	<li>Accidental Death Benefit</li>\r\n	<li>Children&#39;s Insurance</li>\r\n</ul>\r\n\r\n<p>See the Agent Guide for more information.</p>', 'All', NULL, '2022-10-10 10:02:06', '2022-11-15 08:03:50'),
(7, NULL, 4, 'Immediate Solutions - Standard (0-44)', '2F396', 'https://mytranswarequote.transamerica.com/Wl1.html', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', '', NULL, '', '<p>Immediate Solutions Whole Life Insurance:&nbsp;&nbsp;Coverage begins immediately, with a fixed premium and permanent death benefit. Product Features: Issue Ages:&nbsp; 0 - 44 Death Benefit Rage: &nbsp;$1,000 - $40,000 No Phone Interview Required This product is ideal for COPD (not requiring oxygen), obesity, hard of hearing or language barriers (because of no phone interview required)&nbsp;and those receiving disability.&nbsp; Underwriting: Preferred:&nbsp;&nbsp;If the client can answer &quot;No&quot; to all health questions, the client will receive a Preferred rating. Standard:&nbsp;&nbsp;If the client answers &quot;Yes&quot; to only one of the questions in Part&nbsp;C4, the client will receive a Standard rating.&nbsp; Decline:&nbsp;&nbsp;If the client answers &quot;Yes to any question in Part C1, C2, or C3, or if the client answers &quot;Yes&quot; to 2 or more questions in Part C4, the client will be declined from this product.</p>', 'All', NULL, '2022-10-10 10:06:25', '2022-11-15 08:04:11'),
(8, NULL, 4, 'Immediate Solutions - Preferred (0-44)', '1D48F', 'https://mytranswarequote.transamerica.com/Wl1.html', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', '', NULL, '', '<h1>Immediate Solutions</h1>\r\n\r\n<p><strong>Whole Life Insurance:</strong>&nbsp;&nbsp;Coverage begins immediately, with a fixed premium and permanent death benefit.<br />\r\n<br />\r\n<strong>Product Features:</strong></p>\r\n\r\n<ul>\r\n	<li>Issue Ages:&nbsp; 0 - 44</li>\r\n	<li>Death Benefit Rage: &nbsp;$1,000 - $40,000</li>\r\n	<li>No Phone Interview Required</li>\r\n</ul>\r\n\r\n<p>This product is ideal for COPD (not requiring oxygen), hard of hearing or language barriers (because of no phone interview required)&nbsp;and those receiving disability.&nbsp;<br />\r\n<br />\r\n<strong>Underwriting:</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Preferred:</strong>&nbsp;&nbsp;If the client can answer &quot;No&quot; to all health questions, the client will receive a Preferred rating.</li>\r\n	<li><strong>Standard:</strong>&nbsp;&nbsp;If the client answers &quot;Yes&quot; to only one of the questions in Part&nbsp;C4, the client will receive a Standard rating.&nbsp;</li>\r\n	<li><strong>Decline:</strong>&nbsp;&nbsp;If the client answers &quot;Yes to any question in Part C1, C2, or C3, or if the client answers &quot;Yes&quot; to 2 or more questions in Part C4, the client will be declined from this product.</li>\r\n</ul>', 'All', NULL, '2022-10-10 10:23:39', '2022-11-15 08:04:25'),
