(11, NULL, 15, 'Q.L.T.', 'A96D3', 'http://www.sbliagent.com/', 'Tier1', NULL, 'http://www.sbliagent.com/', '', NULL, '', '<p>NO FACE-TO-FACE CONTACT NECESSARY! To help you communicate our unique set of tools to grow and sustain your business, we offer this step-by-step guide to our process. NO FLUIDS, NO EXAM, ACCELERATED UNDERWRITING WITH A GUARANTEED TELE-MED INTERVIEW Our unique Accelerated Underwriting process guarantees no face-to-face contact for all clients, ages 18-60 seeking $750,000 or less of life insurance for all risk classes. We guarantee that no one will be redirected to our traditional underwriting process. Please note eligible risks have been changed temporarily due to the COVID-19 pandemic; applications with a Table 7 or higher rating for ages up to 59, or a Table 3 or higher rating for ages 60 or older, are temporarily postponed. Click below to find out more:</p>', 'All', NULL, '2022-10-10 11:11:18', '2022-11-15 08:05:20'),
(12, NULL, 16, 'Dignity Solutions - Graded', '8A42B', 'https://www.insuranceapplication.com/cgi/webapp/mquotefe2.aspx?s=50&pgm=6&agentnumber=0000119009&company=110', 'Tier1', NULL, 'http://www.occidentallife.com/CGI/SupplyReq/SupplyReqv2.exe', '', NULL, '', '<h1>Dignity Solutions</h1>\r\n\r\n<p><strong>Whole Life Insurance</strong><br />\r\n(Ages 50 through 85)&nbsp;<br />\r\n<br />\r\nThis product is especially good for smokers, insulin dependent diabetics, and those receiving disability. &nbsp;<br />\r\n<br />\r\n<strong>PLAN DESCRIPTIONS:</strong>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Dignity Solutions &quot;Immediate Death Benefit&quot;:</strong>&nbsp;Simplified issue whole life policy with level death benefit of 100% of face amount paid immediately.</li>\r\n	<li><strong>Dignity Solutions &quot;Graded Death Benefit&quot;:</strong>&nbsp;Simplified issue whole life policy which pays 30% of selected face amount the 1st year, 70% paid the 2nd year and 100% paid the 3rd and subsequent years. 100% paid for accidental death, all years.&nbsp;</li>\r\n	<li><strong>Dignity Solutions &quot;Return of Premium Benefit&quot;:</strong>&nbsp;Simplified issue whole life policy which pays return of premium plus 10% interest for 3 years if under age 65, 2 years if age 65 or older. 100% paid after graded period. 100% paid for accidental death, all years.</li>\r\n</ul>\r\n\r\n<p><strong>TELEPHONE INTERVIEW</strong>&nbsp;<br />\r\nA telephone interview conducted with the Proposed Insured is required on every application for the Immediate and Graded Death Benefit Plans prior to the policy being issued. After fully completing the application you may call from the client&rsquo;s home for the personal history telephone interview. The interview is designed to confirm the answers given on the application.&nbsp;<br />\r\n<br />\r\nThe interview can be completed in either of 2 ways:&nbsp;<br />\r\n1) at point-of-sale (recommended), or&nbsp;<br />\r\n2) the Company will contact the Proposed Insured upon receipt of the application.&nbsp;<br />\r\n<br />\r\nPoint-of-sale telephone interviews can be completed by calling one of the toll free numbers below. When calling be sure to identify yourself, Company and product being applied for &quot;Dignity Solutions&quot;. The applicant must always complete the telephone interview without assistance from the agent or another person. If the interview is completed at point-of-sale, mark the &quot;Telephone interview completed&quot; question &quot;Yes&quot; in the upper, right-hand corner of the application. If the sale is made outside of the vendor&#39;s hours of operation or if the interview is not completed at point-of-sale, mark this question &quot;NO&quot; and the Company will initiate the call upon receipt of the application.&nbsp;<br />\r\n<br />\r\nEMSI: 1-866-719-2024&nbsp;<br />\r\nEMSI (Spanish Line): 1-866-901-1776&nbsp;<br />\r\n8am-9pm Monday thru Friday CST&nbsp;<br />\r\n10am-2pm Saturdays CST</p>', 'All', NULL, '2022-10-10 11:15:37', '2022-12-09 10:13:50'),
(13, NULL, 16, 'Dignity Solutions - Immediate', '8A00E', 'https://www.insuranceapplication.com/cgi/webapp/mquotefe2.aspx?s=50&pgm=6&agentnumber=0000119009&company=110', 'Tier1', NULL, 'http://www.occidentallife.com/CGI/SupplyReq/SupplyReqv2.exe', '', NULL, '', '<h1>Dignity Solutions</h1>\r\n\r\n<p><strong>Whole Life Insurance</strong><br />\r\n(Ages 50 through 85)&nbsp;<br />\r\n<br />\r\nThis product is especially good for smokers, insulin dependent diabetics, and those receiving disability. &nbsp;<br />\r\n<br />\r\n<strong>PLAN DESCRIPTIONS:</strong>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Dignity Solutions &quot;Immediate Death Benefit&quot;:</strong>&nbsp;Simplified issue whole life policy with level death benefit of 100% of face amount paid immediately.</li>\r\n	<li><strong>Dignity Solutions &quot;Graded Death Benefit&quot;:</strong>&nbsp;Simplified issue whole life policy which pays 30% of selected face amount the 1st year, 70% paid the 2nd year and 100% paid the 3rd and subsequent years. 100% paid for accidental death, all years.&nbsp;</li>\r\n	<li><strong>Dignity Solutions &quot;Return of Premium Benefit&quot;:</strong>&nbsp;Simplified issue whole life policy which pays return of premium plus 10% interest for 3 years if under age 65, 2 years if age 65 or older. 100% paid after graded period. 100% paid for accidental death, all years.</li>\r\n</ul>\r\n\r\n<p><strong>TELEPHONE INTERVIEW</strong>&nbsp;<br />\r\nA telephone interview conducted with the Proposed Insured is required on every application for the Immediate and Graded Death Benefit Plans prior to the policy being issued. After fully completing the application you may call from the client&rsquo;s home for the personal history telephone interview. The interview is designed to confirm the answers given on the application.&nbsp;<br />\r\n<br />\r\nThe interview can be completed in either of 2 ways:&nbsp;<br />\r\n1) at point-of-sale (recommended), or&nbsp;<br />\r\n2) the Company will contact the Proposed Insured upon receipt of the application.&nbsp;<br />\r\n<br />\r\nPoint-of-sale telephone interviews can be completed by calling one of the toll free numbers below. When calling be sure to identify yourself, Company and product being applied for &quot;Dignity Solutions&quot;. The applicant must always complete the telephone interview without assistance from the agent or another person. If the interview is completed at point-of-sale, mark the &quot;Telephone interview completed&quot; question &quot;Yes&quot; in the upper, right-hand corner of the application. If the sale is made outside of the vendor&#39;s hours of operation or if the interview is not completed at point-of-sale, mark this question &quot;NO&quot; and the Company will initiate the call upon receipt of the application.&nbsp;<br />\r\n<br />\r\nEMSI: 1-866-719-2024&nbsp;<br />\r\nEMSI (Spanish Line): 1-866-901-1776&nbsp;<br />\r\n8am-9pm Monday thru Friday CST&nbsp;<br />\r\n10am-2pm Saturdays CST</p>', 'All', NULL, '2022-10-10 11:18:30', '2022-11-15 08:06:58'),
(14, NULL, 16, 'Home Certainty / Easy Term', '20F2D', 'http://www.insuranceapplication.com/cgi/webapp/mlogin.aspx', 'Tier1', NULL, 'http://www.occidentallife.com/CGI/SupplyReq/SupplyReqv2.exe', '', NULL, '', '<p>PLAN DESCRIPTION Home Certainty is a simplified issue term to age 95 life insurance plan with 15, 20, 25 and 30 year level premium periods. The premiums are guaranteed to remain level for the period selected. Issue Ages (age last birthday) 15 year level premium..................................... Ages 20 &ndash; 65 20 year level premium..................................... Ages 20 &ndash; 60 25 year level premium..................................... Ages 20 &ndash; 55 30 year level premium..................................... Ages 20 &ndash; 50 &nbsp; Minimum Face Amount&nbsp;&mdash; $25,000 face amount or $25.00 monthly premium (excluding riders), whichever is greater &nbsp; Maximum Face Amount&nbsp;&mdash; $250,000 &nbsp; Benefits and Riders (not available in all states) &bull; Return of Premium Rider &bull; Accelerated Living Benefit Rider (Critical Illness): Available at 25%, 50% or 100% acceleration of the death benefit (Up to $100,000 Critical Illness benefit)* &bull; Total Disability Benefit Rider (DIR): 60 day elimination, non-retroactive, monthly benefit 2% of face amount up to $1500 maximum monthly benefit &bull; Waiver of Premium* &bull; Children&rsquo;s Insurance Agreement &bull; Accidental Death Benefit &bull; Level Term Insurance Rider (available on Spouse only) &bull; Terminal Illness Accelerated Benefit Rider - available at no additional premium cost. &bull; Accelerated Benefits Rider-Confined Care - available at no additional premium cost. * Waiver of Premium cannot be issued on the same policy with the Critical Illness Rider.</p>', 'All', NULL, '2022-10-10 11:31:14', '2022-11-15 08:07:30'),
(15, NULL, 7, 'LSW Term - Standard Express', 'C7982', 'https://www.nationallife.com/SecureApps/BusinessDev/Illustration/Views/LifeIllustration.aspx', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', '', NULL, '', '<h1>LSW Term Products</h1>\r\n\r\n<p>Our LSW Term products are low-cost, level premium term policies designed for clients who have a temporary need for life insurance or cannot afford the cost of a permanent life policy at this time.&nbsp;<br />\r\n<br />\r\nOur Term products are focused on value, simplicity and convertibility.&nbsp;<br />\r\n<br />\r\n<strong>Value</strong>&nbsp;&ndash; Through our full line up of Accelerated Benefits Riders, your clients can protect themselves from financial devastation due to an illness that is terminal, chronic or critical or a critical injury.&nbsp;<br />\r\n<br />\r\n<strong>Streamlined &ldquo;No Fluid&rdquo; Underwriting</strong>&nbsp;&ndash; No fluids required for policies with a face amount of $250,000 or less and age 65 or younger.&nbsp;<br />\r\n<br />\r\n<strong>Flexible Conversion Privileges</strong>&nbsp;&ndash; Your clients can lock in their insurability with our Term, and later convert to any of our full suite of permanent products. Conversions are fully commissionable.<br />\r\n<br />\r\n<strong>Issue Ages:&nbsp;</strong>18 - 75<br />\r\n<strong>Minimum Face:</strong>&nbsp; Amount$50,000<br />\r\n<strong>States Available: &nbsp;</strong>Approved in all states&nbsp;EXCEPT: NY<br />\r\n<br />\r\n<strong>No Fluid Products</strong>:&nbsp;<br />\r\nCertain products are offered without routine medical testing up to age 65, up to $250,000 face amount; please refer to the product-specifi c charts for more information. We reserve the right to request medical testing for cause (such as diabetes, morbid obesity, etc).&nbsp;<br />\r\n<br />\r\n<strong>Verified Standard Non-Tobacco:</strong>&nbsp;<br />\r\nOffers competitive rates for applicants who are fully underwritten, who are standard risks and do not use tobacco or nicotine products. If additional table ratings are applicable, use this rate class as the platform for non tobacco class illustrations with ratings.&nbsp;<br />\r\n<br />\r\n<strong>Express Standard Non-Tobacco:</strong>&nbsp;<br />\r\nAvailable to applicants who do not use products containing tobacco or nicotine that qualify as standard under &ldquo;quick underwriting&rdquo; and to those with rating of four tables or less who would otherwise be substandard.<br />\r\n<br />\r\n<strong>Standard Non-Tobacco:</strong>&nbsp;<br />\r\nOffers competitive rates for applicants who are fully underwritten, who are standard risks and do not use tobacco or nicotine products. If additional table ratings are applicable, use this rate class as the platform for non tobacco class illustrations with ratings.<br />\r\n<br />\r\n<strong>Standard Tobacco:</strong>&nbsp;<br />\r\nApplicants who use tobacco or nicotine products that do not otherwise meet the preferred guidelines will use this rate class. If additional table ratings are applicable, use this rate class as the platform for tobacco class illustrations with ratings.</p>', 'All', NULL, '2022-10-10 11:34:08', '2022-11-15 08:08:07'),
