cco or nicotine products. If additional table ratings are applicable, use this rate class as the platform for non tobacco class illustrations with ratings.&nbsp;<br />\r\n<br />\r\n<strong>Express Standard Non-Tobacco:</strong>&nbsp;<br />\r\nAvailable to applicants who do not use products containing tobacco or nicotine that qualify as standard under &ldquo;quick underwriting&rdquo; and to those with rating of four tables or less who would otherwise be substandard.<br />\r\n<br />\r\n<strong>Standard Non-Tobacco:</strong>&nbsp;<br />\r\nOffers competitive rates for applicants who are fully underwritten, who are standard risks and do not use tobacco or nicotine products. If additional table ratings are applicable, use this rate class as the platform for non tobacco class illustrations with ratings.<br />\r\n<br />\r\n<strong>Standard Tobacco:</strong>&nbsp;<br />\r\nApplicants who use tobacco or nicotine products that do not otherwise meet the preferred guidelines will use this rate class. If additional table ratings are applicable, use this rate class as the platform for tobacco class illustrations with ratings.</p>', 'All', NULL, '2022-10-10 11:36:22', '2022-11-15 08:08:22'),
(17, NULL, 14, 'Horizon Value', 'C6C83', 'https://content.sfglife.com/carriers/mutual_trust/IllustrationGuide.pdf', 'Tier1', NULL, '', '', NULL, '', '<p>Horizon Value&trade; is a participating whole life insurance product that is specially designed to produce early, fast growing, guaranteed cash values. In many situations, by the fourth year the increase in cash value for the year will exceed the premiums paid in that year.<br />\r\n&nbsp;</p>\r\n\r\n<p>Horizon Value is available for ages 0-75, paid up at age 90 and matures at 121. Extremely versatile, it can be</p>\r\n\r\n<p>customized to fit specific needs with the addition of a variety of optional riders and benefits.<br />\r\n&nbsp;</p>\r\n\r\n<p>Personal Uses include: Mortgage protection and acceleration, educational funding, retirement income, income</p>\r\n\r\n<p>replacement, estate planning, gifting and more.<br />\r\n&nbsp;</p>\r\n\r\n<p>Business Uses include: Buy/sell funding, key person protection, executive bonus programs and deferred compensation</p>', 'All', NULL, '2022-10-10 11:38:40', '2022-11-15 08:08:45'),
(18, NULL, 1, 'Children\'s Whole Life', '60193', 'https://www3.mutualofomaha.com/mobile-quotes/#/home', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', '', NULL, 'https://youtu.be/oYHo6R0iI7s', '<p>Children&rsquo;s Whole Life is affordable and easy-to-apply-for life insurance protection, with the following features:&nbsp;  Available for ages 14 days to 17 years, in face amounts of $5,000 to $50,000  Whole life &ndash; policy matures at age 100  No medical examination required&nbsp;  Rates never increase with age&nbsp;  Benefits never decrease&nbsp;  Cash value that builds over time&nbsp;  Additional coverage may be purchased in the future without evidence of insurability&nbsp;  Easy payment options &nbsp;</p>', 'All', NULL, '2022-10-10 11:40:53', '2022-11-15 08:08:59'),
(19, NULL, 1, 'Living Promise', 'DE2BB', 'https://www3.mutualofomaha.com/mobile-quotes/#/home', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', '', NULL, '', '<h2>Level Benefit Plan:</h2>\r\n\r\n<p>&bull;&nbsp;<strong>Death Benefit</strong>: 100% &bull; Issue Ages: 45-85</p>\r\n\r\n<p>&bull;&nbsp;<strong>Face Amounts</strong>: $2,000 &ndash; $40,000 (in WA, $5,000 &ndash; $40,000)</p>\r\n\r\n<p>&bull;&nbsp;<strong>Underwriting Classes</strong>: Standard Tobacco/Nontobacco</p>\r\n\r\n<p>&bull;&nbsp;<strong>Underwriting Requirements</strong>: MIB, pharmaceutical check, random phone interviews<br />\r\n&nbsp;</p>\r\n\r\n<h2>Apptical&trade; Interviews</h2>\r\n\r\n<p><strong>APPTICAL IS AVAILABLE TO CONDUCT INTERVIEWS DURING THE FOLLOWING HOURS:</strong></p>\r\n\r\n<p><strong>Monday &ndash; Friday</strong>: 8:30 a.m. &ndash; 2:00 a.m. (ET)</p>\r\n\r\n<p><strong>Saturday &ndash; Sunday</strong>: 10:00 a.m. &ndash; 10:00 p.m. (ET)</p>\r\n\r\n<p><strong>Phone</strong>: 855-464-9577<br />\r\n&nbsp;</p>\r\n\r\n<p>The following four steps explain how to complete the point-of-sale application process.<br />\r\n<br />\r\n<strong>Step 1: Call Apptical</strong><br />\r\nOnce the paper application has been completed, call Apptical at 855-464-9577 to begin the POS interview process. *Please note: It is very important that you write the PHI number provided on</p>\r\n\r\n<p>the application. Not doing so risks incorrect processing.<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Step 2:&nbsp;Personal Health Interview (PHI)</strong><br />\r\nAt this point, the client is asked to get on the phone. While the client is answering the health questions, Apptical will run the following checks: MIB record &amp; Prescription history<br />\r\n<br />\r\n<strong>Step 3: Eligibility Results</strong></p>\r\n\r\n<p>You (The Producer) will be asked to get back on the phone to receive the eligibility results of the case.<br />\r\n<br />\r\n<strong>Step 4: Final Results</strong></p>\r\n\r\n<p>Once the application is received, if the client has any existing coverage with the Mutual of Omaha companies or has applied for coverage in the past, United of Omaha will review that information prior to providing the final underwriting decision. Any information available could result in a change to the eligibility decision provided by Apptical.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>ADDITIONAL BENEFITS &ndash; LEVEL BENEFIT PLAN ONLY</h2>\r\n\r\n<p><em>Accelerated Death Benefit for Terminal Illness or Nursing Home Confinement&nbsp;</em><em>Rider* (not available in New York)</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Allows the owner a one-time election to receive the Accelerated Benefit if the insured is either: (a) diagnosed as having a terminal illness that, with a reasonable degree of certainty, will result in the insured&rsquo;s death within 12 months or less from the date a physician signs the statement of proof of terminal illness, (b) has been confined to a nursing home for 90 consecutive days or more and is expected to remain confined in a nursing home for the duration of the insured&rsquo;s life; in FL, or (c) certified by a physician that the insured is unable to perform (without substantial assistance from another person) at least two activities of daily living due to a chronic illness.</p>\r\n\r\n<p><br />\r\n<em>* Accelerated Death Benefit for Terminal Illness or Chronic Illness Rider in FL; Accelerated Death Benefit for Terminal Illness Rider in CT.</em></p>\r\n\r\n<p><br />\r\n<strong>Optional: Accidental Death Benefit Rider</strong></p>\r\n\r\n<p>This Rider provides an additional death benefit equal to the policy&rsquo;s face amount if the death of the insured results from accidental bodily injury and independently of sickness and all other causes.</p>', 'All', NULL, '2022-10-10 11:43:17', '2022-11-15 08:09:22'),
(20, NULL, 1, 'Guaranteed ADvantage - Accidental Death Only', '2989B', 'https://www3.mutualofomaha.com/mobile-quotes/#/home', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', '', NULL, '', '<p><strong>Guaranteed ADvantage Accidental Death Insurance</strong>&nbsp;covers your client in the case of death resulting from an accident. The application process is easy &ndash; no health questions, medical exams or occupational restrictions. Guaranteed ADvantage is guaranteed coverage so your client cannot be turned down.&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Issues Ages: &mdash; 18-70 Accidental Death Bene ts: &mdash; $50,000&ndash;$500,000 (increments of $1,000)</li>\r\n	<li>\r\n	<ul>\r\n		<li>Spouse coverage is 100%&nbsp;of the Proposed Insured coverage and child coverage is 20 percent of the Proposed Insured coverage</li>\r\n		<li>24-hour all accident coverage</li>\r\n		<li>Common Carrier Benet: provides an additional death benet equal to the base accidental death benet</li>\r\n		<li>Auto Pedestrian Benet: pays an additional 25% of the accidental death benet Family Coverage:</li>\r\n	</ul>\r\n	</li>\r\n	<li>Spouse is eligible if&nbsp;age18-70 and may remain on the policy until age 80</li>\r\n	<li>Unmarried dependent children under the age of 19, or age 23, if a full-time student at an accredited college or university State specials will apply &bull; Dependent child coverage ends at age 21 or 25 if a full-time student Optional Rider: &mdash; Returnof Premium Benet* &ndash;Returns a percentage of premiums paid (minus any claims paid) when the policy terminates for any reason other than accidental death.</li>\r\n	<li>Issue Ages 18-50</li>\r\n	<li>If applying for family coverage, both insureds must be age 50 and under at the time of application *ROP rider is not available in AR, CT, GA, NY, PA and VA&nbsp;</li>\r\n	<li>\r\n	<p>Agents must have a current health appointment with Mutual of Omaha<br />\r\n	- The initial premium will be withdrawn at time of application submission (not the effective date or date signed on the application).&nbsp;<br />\r\n	- Any communications from underwriting will be sent to the email address of the agent written on the application. Please make sure the email address and phone numbers are correct.<br />\r\n	- Applications must be received in the home office within 30 days of the application sign date.&nbsp;<br />\r\n	- The Return of Premium (ROP) rider is not available in AR, CT, GA, NY, PA or VA.<br />\r\n	- Non-U.S. Citizens may be covered as long as they have a permanent resident card (green card) and have resided in the country longer than 1 year</p>\r\n\r\n	<p>&bull; Grandparent&nbsp;are a few points to remember when offering AD to your clients:</p>\r\n\r\n	<p>- The application must be for the client&rsquo;s state of residence</p>\r\n\r\n	<p>Omaha&nbsp;</p>\r\n	</li>\r\n</ul>', 'All', NULL, '2022-10-10 11:45:12', '2022-11-15 08:09:43');
INSERT INTO `product` (`id`, `id_group_bmi`, `id_company`, `name`, `product_code`, `run_quote`, `sort_by`, `agent_guide`, `application_url`, `product_video`, `require_eo`, `sales_training_video`, `description`, `gender`, `create_date`, `created_at`, `updated_at`) VALUES
(21, NULL, 1, 'Term Express', 'FC9F7', 'https://www3.mutualofomaha.com/mobile-quotes/#/home', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', '', NULL, '', '<p><strong>Completing Simplified Applications</strong></p>\r\n\r\n<p><br />\r\nOne base policy per application.</p>\r\n\r\n<ul>\r\n	<li>Select the product name and write in the amount of the insurance applied for</li>\r\n	<li>If applying for any rider offering Disability Benefits, complete the supplemental application</li>\r\n	<li>If applying for the Children&rsquo;s Rider, complete the Supplemental application</li>\r\n	<li>Complete the Monthly Bank Withdrawal form if applicable</li>\r\n	<li>Attach cover letter or additional information, as needed</li>\r\n	<li>All changes should be initialed by the Applicant/Owner</li>\r\n	<li>Always submit the Producer Statement and always provide client with MIB Group Inc. Pre-Notice, Notice of Information Practices, and Life Insurance Buyers Guide</li>\r\n	<li>Submit a signed Accelerated Death Benefit Form</li>\r\n	<li>Complete Conditional Receipt Form.&nbsp;<strong>If a check or electronic transaction authorization for the initial premium was not collected</strong>&nbsp;at the time of application, do not complete this form</li>\r\n	<li><strong>Have client sign state replacement forms (if applicable) and provide a copy to the client</strong></li>\r\n	<li>If a Financial Institution would receive compensation for a sale, the Financial Institution Consumer Disclosure must be signed by the client</li>\r\n</ul>\r\n\r\n<p>For additional information, please refer to the appropriate Application Submission Checklist.</p>', 'All', NULL, '2022-10-10 11:48:11', '2022-11-15 08:09:55'),
(22, NULL, 11, 'Simple Term with Vitality', '4A1FC', 'https://instant-apply.johnhancockinsurance.com/get-a-quote-brokerage', 'Tier1', NULL, 'http://www.jhsimpletermquotes.com', 'https://www.youtube.com/watch?v=fdTuVet_Wc8', NULL, '', '<p><strong>Simple Term with Vitality</strong><br />\r\n<br />\r\nSimple Term with Vitality provides your clients an affordable, instant-decision life insurance solution as well an industry-only premium cash back feature and rewards for healthy living.<br />\r\n<br />\r\nKey highlights:<br />\r\n&bull;1015-, 20-, 25-, 30-year term durations<br />\r\n&bull; Maximum issue age of 60<br />\r\n&bull; Face amounts ranging between $25,000 and $500,000<br />\r\n&bull; Instant underwriting decision<br />\r\n&bull; Premium cash back feature and rewards through the John Hancock Vitality PLUS Program which is included with every policy,.<br />\r\n<br />\r\n<strong>The John Hancock Vitality PLUS Program provides:</strong><br />\r\n&nbsp;Up to 15% in premium cash back3 each year for engaging in the program<br />\r\n<br />\r\n&bull; The Apple Watch&reg; Series for as little as $254 by exercising regularly<br />\r\n<br />\r\n&bull; A one-year Amazon Prime membership when your clients reach Platinum status three years in a row<br />\r\n<br />\r\n&bull; A complimentary Fitbit&reg; device or another discounted fitness tracker like Garmin or Polar instead of the Apple Watch<br />\r\n<br />\r\n&bull; Discounts of up to 25% at more than 350,000 eligible properties worldwide with Hotels.com5<br />\r\n<br />\r\n&bull; A HealthyFood&trade; benefit with up to $600 in annual savings on healthy food purchases &mdash; at 16,000 stores nationwide6<br />\r\n<br />\r\n&bull; A HealthyMind&trade; benefit that rewards your clients for meditating as little as 10 minutes a day and for getting a good night&rsquo;s sleep<br />\r\n<br />\r\n&bull; A free 12-month subscription to Headspace&reg;, a top-rated meditation app with millions of users in more than 190 countries<br />\r\n<br />\r\n&bull; Entertainment and shopping rewards and discounts&nbsp;</p>', 'All', NULL, '2022-10-10 11:50:51', '2022-11-15 08:10:05'),
(23, NULL, 6, 'Gerber Guaranteed Issue', '401F6', 'http://sfgvirtualmentor.com/guides/GL_rate_card.pdf', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', '', NULL, '', '<p><strong>Description</strong><br />\r\nGuaranteed Whole Life Coverage that can be used for Funeral / Final Expenses</p>\r\n\r\n<ul>\r\n	<li><strong>State Availability:</strong>&nbsp;Available in all states except MT.</li>\r\n	<li><strong>Issue Ages:</strong>&nbsp;50 &ndash; 80 (age last birthday)&nbsp;</li>\r\n	<li><strong>Policy Size:</strong>&nbsp;$5,000 minimum amount to $25,000 maximum amount at issue (total of all combined Gerber Life Guaranteed Life policies is $25,000). The maximum face amount is $15,000 in South Dakota.&nbsp;</li>\r\n	<li><strong>Cash Value:</strong>&nbsp;Plan builds some cash value.&nbsp;</li>\r\n	<li><strong>Death Benefit:&nbsp;</strong>Graded Death Benefit (DB) in first 2 policy years. If death occurs within the first two policy years for any reason other than an accident, all premiums shall be paid to the beneficiary, plus 10% interest on earned premiums. Earned premium refers to the portion of paid premium that has been applied to the policy. For example, if an annual premium payment is made, six months into the policy year, half of the total premium is considered &ldquo;earned.&rdquo; If death is due to accidental causes within the first two policy years, the full death benefit will be paid to the beneficiary. After the two-year Graded Death Benefit period, if the insured dies for any reason the full face amount of the policy shall be paid to the beneficiary.&nbsp;</li>\r\n	<li><strong>Grace Period:</strong>&nbsp;31 days starting on premium due date (60 days in CA), in which owner may pay overdue premiums.&nbsp;</li>\r\n	<li><strong>Underwriting:</strong>&nbsp;None&mdash;Guaranteed Issue.&nbsp;</li>\r\n	<li><strong>Modal Payments:</strong>&nbsp;Monthly, Quarterly, Semi-Annual and Annual. ACH (up to 8% discount) and Credit Card available.&nbsp;</li>\r\n	<li><strong>Free Look:</strong>&nbsp;30-day free look period beginning 3 days after policy is mailed.</li>\r\n</ul>', 'All', NULL, '2022-10-10 11:55:02', '2022-11-15 08:10:19'),
(24, NULL, 9, 'Plan Right ( Level Death Benefit )', '755E9', 'http://www.foresterscalculator.com/calculator/', 'Tier1', NULL, '', '', NULL, '', '<p>PlanRight has three certificate types that offer different levels of coverage: &nbsp;&bull; PlanRight Level: the death benefit is based on7 100% of the face amount in effect. &nbsp;&bull; PlanRight Graded: has a limited death benefit in the first two years, which is based on7 the greater of a) the sum of the total premiums paid accumulated with 4.5% interest8 , or b) 30% of the face amount in effect in the first year, and 70% of the face amount in effect during the second year. From year three onward, the death benefit is based on7 100% of the face amount in effect. &nbsp;&bull; PlanRight Modified: has a limited death benefit in the first two years which is based on7 the return of premiums paid plus 10% interest8 . From year three onward, the death benefit is based on7 100% of the face amount in effect.</p>', 'All', NULL, '2022-10-10 12:03:09', '2022-11-15 08:10:30'),
(25, NULL, 9, 'Strong Foundations', '4A895', 'http://www.foresterscalculator.com/calculator/', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', '', NULL, '', '<p><strong>HIGHLIGHTS</strong><br />\r\nNon-medical from $25,000 to&nbsp;$400,000 for ages 16-70. &nbsp;Convertible permanent insurance&nbsp;without evidence of insurability. &nbsp;Additional riders available: children&#39;s term, disability, accidental death, and waiver of premium. Credited interest rate guaranteed 3.0% minimum and a current rate of&nbsp;<br />\r\n<br />\r\n<strong>PRODUCT INFORMATION&nbsp;</strong><br />\r\nIndividual life insurance coverage is provided by Foresters&trade;, a trademark of The Independent Order of Foresters, a fraternal benefit society, 789 Don Mills Road, Toronto, Ontario Canada, M3C 1T9.&nbsp;<br />\r\n<br />\r\nUnderwriting guidelines, procedures and forms may vary by type of life insurance and state. Be sure to consult all materials relative to your specific product and state. By following the procedures outlined in this manual and the marketing guidelines you will maximize your percentage of issued life insurance applications.<br />\r\n<br />\r\n<strong>OCCUPATION</strong>&nbsp;<br />\r\nThe occupation of a proposed insured is a major factor in their eligibility and many of those occupations may eliminate an applicant from qualifying for the basic product and possibly DIR (accident only) and DIR (accident &amp; sickness).&nbsp;<br />\r\n<br />\r\nApplicants with occupations that are exceptionally hazardous will be declined or rated, for example:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Any occupation that involves working above certain heights</li>\r\n	<li>Any that involves handling explosives&nbsp;</li>\r\n	<li>Any that involves handling hazardous materials&nbsp;</li>\r\n</ul>\r\n\r\n<p>For Disability Income Protection Rider (accident only) please refer to Page 17 of this Guide for excluded occupations or for Disability Income Rider (Accident and Sickness) please refer to Foresters Accident &amp; Sickness Disability Income Rider Occupational Classification Listing.<br />\r\n<br />\r\n<strong>NON-MEDICAL</strong>&nbsp;<br />\r\nNon-Medical underwriting requires answers to all medical questions on the application. A Pharmacy and an MIB check will be run on every proposed insured. In the event of a discrepancy in information from these sources, the Foresters service center will call the proposed insured for a telephone interview. If the proposed insured does not qualify for nonmedical rates, the application will be declined. A new application may be submitted for a fully underwritten product.&nbsp;<br />\r\n<br />\r\n<strong>AGE &amp; AMOUNT REQUIREMENTS</strong>&nbsp;(Lifefirst Fully Underwritten &amp; BIG UL)&nbsp;<br />\r\nTo help your underwriter with the evaluation process you are responsible for ordering requirements from a third party provider (See Approved Vendors). A representative from the selected third party provider will call your client to schedule an appointment to complete the necessary requirements (outlined in the appropriate age and amount requirement charts).&nbsp;<br />\r\n<br />\r\nThe risk appraisal is based on information obtained from the following sources:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Application&nbsp;</li>\r\n	<li>Attending Physician&rsquo;s Statements (APS), (if required)&nbsp;</li>\r\n	<li>Blood Profile&nbsp;</li>\r\n	<li>Department of Motor Vehicle (MVR), (if required)&nbsp;</li>\r\n	<li>ECG or Stress Test&nbsp;</li>\r\n	<li>Inspection Reports&nbsp;</li>\r\n	<li>Medical Examination&nbsp;</li>\r\n	<li>Medical Information Bureau (MIB)&nbsp;</li>\r\n	<li>Paramedical Examination&nbsp;</li>\r\n	<li>Pharmaceutical Records&nbsp;</li>\r\n	<li>Special Questionnaires&nbsp;</li>\r\n	<li>Urinalysis (included with Blood Profile unless otherwise stated)&nbsp;</li>\r\n	<li>Vitals&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>AGE &amp; AMOUNT REQUIREMENTS CHARTS</strong><br />\r\nIt is important to note the following:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>At ages 75 and up, a completed Activities of Daily Living Questionnaire (ADLQ) is required with the application form submission.&nbsp;</li>\r\n	<li>For additional insurance (within 12 months) age and amount requirements will be based on the total insurance inforce and applied for with all companies.&nbsp;</li>\r\n	<li>Additional requirements may be requested by the underwriter to obtain details of declared histories</li>\r\n</ul>', 'All', NULL, '2022-10-10 12:37:41', '2022-11-15 08:10:43'),
(26, NULL, 9, 'SMART UL', 'C2DC1', 'http://www.foresterscalculator.com/calculator/', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', '', NULL, '', '<p><strong>HIGHLIGHTS</strong><br />\r\nNon-medical from $25,000 to&nbsp;$400,000 for ages 16-70. &nbsp;Convertible perminent insurance&nbsp;without evidence of insurability. &nbsp;Additional riders available: children&#39;s term, disability, accidental death, and waiver of premium. Credited interest rate guaranteed 3.0% minimum and a current rate of&nbsp;<br />\r\n<br />\r\n<strong>PRODUCT INFORMATION&nbsp;</strong><br />\r\nIndividual life insurance coverage is provided by Foresters&trade;, a trademark of The Independent Order of Foresters, a fraternal benefit society, 789 Don Mills Road, Toronto, Ontario Canada, M3C 1T9.&nbsp;<br />\r\n<br />\r\nUnderwriting guidelines, procedures and forms may vary by type of life insurance and state. Be sure to consult all materials relative to your specific product and state. By following the procedures outlined in this manual and the marketing guidelines you will maximize your percentage of issued life insurance applications.<br />\r\n<br />\r\n<strong>OCCUPATION</strong>&nbsp;<br />\r\nThe occupation of a proposed insured is a major factor in their eligibility and many of those occupations may eliminate an applicant from qualifying for the basic product and possibly DIR (accident only) and DIR (accident &amp; sickness).&nbsp;<br />\r\n<br />\r\nApplicants with occupations that are exceptionally hazardous will be declined or rated, for example:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Any occupation that involves working above certain heights</li>\r\n	<li>Any that involves handling explosives&nbsp;</li>\r\n	<li>Any that involves handling hazardous materials&nbsp;</li>\r\n</ul>\r\n\r\n<p>For Disability Income Protection Rider (accident only) please refer to Page 17 of this Guide for excluded occupations or for Disability Income Rider (Accident and Sickness) please refer to Foresters Accident &amp; Sickness Disability Income Rider Occupational Classification Listing.<br />\r\n<br />\r\n<strong>NON-MEDICAL</strong>&nbsp;<br />\r\nNon-Medical underwriting requires answers to all medical questions on the application. A Pharmacy and an MIB check will be run on every proposed insured. In the event of a discrepancy in information from these sources, the Foresters service center will call the proposed insured for a telephone interview. If the proposed insured does not qualify for nonmedical rates, the application will be declined. A new application may be submitted for a fully underwritten product.&nbsp;<br />\r\n<br />\r\n<strong>AGE &amp; AMOUNT REQUIREMENTS</strong>&nbsp;(Lifefirst Fully Underwritten &amp; BIG UL)&nbsp;<br />\r\nTo help your underwriter with the evaluation process you are responsible for ordering requirements from a third party provider (See Approved Vendors). A representative from the selected third party provider will call your client to schedule an appointment to complete the necessary requirements (outlined in the appropriate age and amount requirement charts).&nbsp;<br />\r\n<br />\r\nThe risk appraisal is based on information obtained from the following sources:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Application&nbsp;</li>\r\n	<li>Attending Physician&rsquo;s Statements (APS), (if required)&nbsp;</li>\r\n	<li>Blood Profile&nbsp;</li>\r\n	<li>Department of Motor Vehicle (MVR), (if required)&nbsp;</li>\r\n	<li>ECG or Stress Test&nbsp;</li>\r\n	<li>Inspection Reports&nbsp;</li>\r\n	<li>Medical Examination&nbsp;</li>\r\n	<li>Medical Information Bureau (MIB)&nbsp;</li>\r\n	<li>Paramedical Examination&nbsp;</li>\r\n	<li>Pharmaceutical Records&nbsp;</li>\r\n	<li>Special Questionnaires&nbsp;</li>\r\n	<li>Urinalysis (included with Blood Profile unless otherwise stated)&nbsp;</li>\r\n	<li>Vitals&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>AGE &amp; AMOUNT REQUIREMENTS CHARTS</strong>&nbsp;(Lifefirst Fully Underwritten &amp; BIG UL)&nbsp;<br />\r\nIt is important to note the following:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>At ages 75 and up, a completed Activities of Daily Living Questionnaire (ADLQ) is required with the application form submission.&nbsp;</li>\r\n	<li>For additional insurance (within 12 months) age and amount requirements will be based on the total insurance inforce and applied for with all companies.&nbsp;</li>\r\n	<li>Additional requirements may be requested by the underwriter to obtain details of declared histories</li>\r\n</ul>', 'All', NULL, '2022-10-10 12:42:21', '2022-11-15 08:10:56'),
(27, NULL, 2, 'Payment Protector', 'FADEA', 'https://quote.americo.com:9443/Mobile', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', 'https://americo.wistia.com/medias/gaj0t5x44q', NULL, '', '<p>The HMS Plus Payment Protector decreasing term life insurance offered by Americo Financial Life and Annuity Insurance Company is designed to provide a death benefit paid in monthly income payments, until the end of the Monthly Income Death Benefit Period.</p>', 'All', NULL, '2022-10-10 12:54:39', '2022-11-15 08:11:08'),
(28, NULL, 2, 'Term 100/Term 125/Continuation', '67671', 'https://quote.americo.com:9443/Mobile', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', 'https://americo.wistia.com/medias/dia9g9eoec', NULL, '', '<p>Home Mortgage Series is specially designed term and universal life insurance products. Clients choose 30, 25, 20, or 15-year term periods and then either a fully guaranteed or a five-year guaranteed option. With many available riders, it&rsquo;s easy to customize Home Mortgage Series to fit almost any client. Death Benefit range:&nbsp; $25,000 - $400,000</p>', 'All', NULL, '2022-10-10 12:57:42', '2022-11-15 08:11:21'),
(29, NULL, 2, 'Eagle Premier', 'FC68C', 'https://quote.americo.com:9443/Mobile', 'Tier1', NULL, 'tools.americoagent.com', 'https://americo.wistia.com/medias/isw1lhen5t', NULL, '', '<h1>Eagle Premier Series</h1>\r\n\r\n<p><strong>Whole Life Insurance:</strong>&nbsp;&nbsp;Fixed premiums and permanent death benefit.<br />\r\n<br />\r\nNOTE: &nbsp;This product is ideal for chewing tobacco,&nbsp;pipe &amp; cigar smokers, as they will receive a non-smoker rate. &nbsp;Also, for a client who had a major heart issue between 1-2 years ago. &nbsp;<br />\r\n<br />\r\n<strong>Underwriting: &nbsp;</strong>All health questions must be answered &quot;No&quot;, otherwise the client will get declined. &nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<h3><strong>No Paper Applications:</strong></h3>\r\n\r\n<p>There is no paper application required for this product. &nbsp;It&#39;s all done either over the phone with an underwriter or on Americo.com through an E-App. &nbsp;<br />\r\n<br />\r\n<br />\r\n<strong>TeleAppliaction Process:</strong><br />\r\n<br />\r\n<strong>1. Prior to Calling Americo&rsquo;s Call Center:</strong></p>\r\n\r\n<ul>\r\n	<li>Collect the necessary information: &nbsp;The Eagle Premier Series worksheets can be used to help collect all the necessary information. Using the worksheet will help to speed up the call process. &nbsp;</li>\r\n	<li>Prepare the Insured, Owner, and Payor. &nbsp;Make sure the Insured understands they will be calling Americo to apply for coverage. Explain it is best to answer&nbsp;honestly and with &ldquo;yes&rdquo; and &ldquo;no&rdquo; answers.</li>\r\n</ul>\r\n\r\n<p><strong>2. Call Americo at 855.248.8327.&nbsp;</strong>&nbsp;<br />\r\nMake sure you have the Insured, Owner, and Payor, on the call with you. The Owner and Payor need to be available if different than Insured.<br />\r\n<br />\r\n<strong>3. Americo will provide you and your client a decision over the phone.</strong><br />\r\n<br />\r\n<strong>4. Americo will then ask for a Verbal Signature to apply for coverage.</strong><br />\r\nThis will end the call with the Insured/Owner/Payor.<br />\r\n<br />\r\n<strong>5. Americo will ask for your Agent Statement to end the call.</strong><br />\r\n<br />\r\n<strong>6. Americo will mail the Insured/Owner/Payor a cover letter with disclosures in the Policy Packet.</strong><br />\r\nIf the client declines the coverage, disclosures will be sent under a separate letter.<br />\r\n<br />\r\n<strong>E-Application Process</strong></p>\r\n\r\n<ul>\r\n	<li>1. To access Sales Connection, you will need to create an Account on our secure website. You must be appointed with Americo to register and you can only create one account.&nbsp;</li>\r\n	<li>2. You will need the following to register - your full name, exactly as it appears on your Insurance License; the last four digits of your Social Security Number; your Americo Agent ID; and a valid email address.&nbsp;</li>\r\n	<li>3. Go to sc.americo.com (note there is no www).&nbsp;</li>\r\n	<li>4. Click on &ldquo;Create New Agent Account.&rdquo;&nbsp;</li>\r\n	<li>5. Click &ldquo;Next&rdquo; and follow the instructions to register.&nbsp;</li>\r\n	<li>6. Fill in the fields marked with *. Your name must match the name on your Insurance License. Click &ldquo;Next&rdquo; to continue.&nbsp;</li>\r\n	<li>7. Create a Username and Password you will remember. Note the Username/Password requirements listed on the screen. Once you&rsquo;ve filled in your Username and Password, fill in the Captcha Value shown on the screen, click &ldquo;Next.&rdquo;&nbsp;</li>\r\n	<li>8. To complete the registration, select 5 security questions from the drop down list and fill in the answers. This will assist you in resetting your Username and Password if you forget one of these. Once completed, click &ldquo;Next.&rdquo;&nbsp;</li>\r\n	<li>9. You have now completed the registration process. Click &ldquo;Finish&rdquo; to be redirected to the Sales Connection page.&nbsp;</li>\r\n	<li>10. Enter the Username and Password that you&rsquo;ve just created to begin using Sales Connection.</li>\r\n</ul>', 'All', NULL, '2022-10-10 13:00:24', '2022-11-15 08:11:33'),
(30, NULL, 2, 'Cash Back Option  CBO 100 and CBO 50', '4E104', 'https://quote.americo.com:9443/Mobile', 'Tier1', NULL, 'https://formspipe.ipipeline.com/?GAID=6503', 'https://americo.wistia.com/medias/znyvwrak4s', NULL, '', '<p>Home Mortgage Series CBO (cash back option) is specially designed term and universal life insurance products. Clients choose 30, 25, 20, or 15-year term periods and then either a fully guaranteed or a five-year guaranteed option. With many available riders, it&rsquo;s easy to customize Home Mortgage Series to fit almost any client. Death Benefit range:&nbsp; $25,000 - $400,000</p>', 'All', NULL, '2022-10-10 13:04:12', '2022-11-15 08:11:47'),
(31, NULL, 3, 'Express Term', 'E8DA9', 'https://www.insuranceapplication.com/cgi/webapp/mquoteET.aspx?agentnumber=0000119009&company=110', 'Tier1', NULL, 'https://www.insuranceapplication.com/cgi/webapp/mobile/', '', NULL, '', '<p><strong>PLAN DESCRIPTION</strong></p>\r\n\r\n<p>Express Term is a simplified issue term to age 95 life insurance plan with 10, 15, 20, 25 and 30 year level premium periods. The premiums are guaranteed to remain level for the period selected.</p>\r\n\r\n<p><br />\r\n<strong>Issue Ages (age last birthday)</strong></p>\r\n\r\n<p>10 year level premium..................................... Ages 20 &ndash; 75<br />\r\n15 year level premium..................................... Ages 20 &ndash; 65</p>\r\n\r\n<p>20 year level premium..................................... Ages 20 &ndash; 60</p>\r\n\r\n<p>25 year level premium..................................... Ages 20 &ndash; 55</p>\r\n\r\n<p>30 year level premium..................................... Ages 20 &ndash; 50<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Minimum Face Amount</strong>&nbsp;&mdash; $25,000 face amount or $25.00 monthly premium (excluding riders),</p>\r\n\r\n<p>whichever is greater<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Maximum Face Amount</strong>&nbsp;&mdash; $250,000<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Benefits and Riders (not available in all states)</strong></p>\r\n\r\n<p>&bull; Return of Premium Rider</p>\r\n\r\n<p>&bull; Accelerated Living Benefit Rider (Critical Illness): Available at 25%, 50% or 100% acceleration of the death benefit (Up to $100,000 Critical Illness benefit)*</p>\r\n\r\n<p>&bull; Total Disability Benefit Rider (DIR): 60 day elimination, non-retroactive, monthly benefit 2% of face</p>\r\n\r\n<p>amount up to $1500 maximum monthly benefit</p>\r\n\r\n<p>&bull; Waiver of Premium*</p>\r\n\r\n<p>&bull; Children&rsquo;s Insurance Agreement</p>\r\n\r\n<p>&bull; Accidental Death Benefit</p>\r\n\r\n<p>&bull; Level Term Insurance Rider (available on Spouse only)</p>\r\n\r\n<p>&bull; Terminal Illness Accelerated Benefit Rider - available at no additional premium cost.</p>\r\n\r\n<p>&bull; Accelerated Benefits Rider-Confined Care - available at no additional premium cost.</p>\r\n\r\n<p>* Waiver of Premium cannot be issued on the same policy with the Critical Illness Rider.</p>\r\n\r\n<p>&nbsp;</p>', 'All', NULL, '2022-10-10 13:11:14', '2022-11-15 08:11:59'),
(32, NULL, 3, 'Dignity Solutions - Graded', 'E0746', 'https://www.insuranceapplication.com/cgi/webapp/mquotefe2.aspx?s=50&pgm=6&agentnumber=0000119009&company=110', 'Tier1', NULL, 'https://www.americanamicable.com/CGI/SupplyReq/SupplyReqv2.exe', '', NULL, '', '<h1>Dignity Solutions</h1>\r\n\r\n<p><strong>Whole Life Insurance</strong><br />\r\n(Ages 50 through 85)&nbsp;<br />\r\n<br />\r\nThis product is especially good for smokers, insulin dependent diabetics, and those receiving disability. &nbsp;<br />\r\n<br />\r\n<strong>PLAN DESCRIPTIONS:</strong>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Dignity Solutions &quot;Immediate Death Benefit&quot;:</strong>&nbsp;Simplified issue whole life policy with level death benefit of 100% of face amount paid immediately.</li>\r\n	<li><strong>Dignity Solutions &quot;Graded Death Benefit&quot;:</strong>Simplified issue whole life policy which pays 30% of selected face amount the 1st year, 70% paid the 2nd year and 100% paid the 3rd and subsequent years. 100% paid for accidental death, all years.&nbsp;</li>\r\n	<li><strong>Dignity Solutions &quot;Return of Premium Benefit&quot;:</strong>&nbsp;Simplified issue whole life policy which pays return of premium plus 10% interest for 3 years if under age 65, 2 years if age 65 or older. 100% paid after graded period. 100% paid for accidental death, all years.</li>\r\n</ul>\r\n\r\n<p><strong>TELEPHONE INTERVIEW</strong>&nbsp;<br />\r\nA telephone interview conducted with the Proposed Insured is required on every application for the Immediate and Graded Death Benefit Plans prior to the policy being issued. After fully completing the application you may call from the client&rsquo;s home for the personal history telephone interview. The interview is designed to confirm the answers given on the application.&nbsp;<br />\r\n<br />\r\nThe interview can be completed in either of 2 ways:&nbsp;<br />\r\n1) at point-of-sale (recommended), or&nbsp;<br />\r\n2) the Company will contact the Proposed Insured upon receipt of the application.&nbsp;<br />\r\n<br />\r\nPoint-of-sale telephone interviews can be completed by calling one of the toll free numbers below. When calling be sure to identify yourself, Company and product being applied for &quot;Dignity Solutions&quot;. The applicant must always complete the telephone interview without assistance from the agent or another person. If the interview is completed at point-of-sale, mark the &quot;Telephone interview completed&quot; question &quot;Yes&quot; in the upper, right-hand corner of the application. If the sale is made outside of the vendor&#39;s hours of operation or if the interview is not completed at point-of-sale, mark this question &quot;NO&quot; and the Company will initiate the call upon receipt of the application.&nbsp;<br />\r\n<br />\r\nEMSI: 1-866-719-2024&nbsp;<br />\r\nEMSI (Spanish Line): 1-866-901-1776&nbsp;<br />\r\n8am-9pm Monday&nbsp;thru Friday CST&nbsp;<br />\r\n10am-2pm&nbsp;Saturdays CST</p>', 'All', NULL, '2022-10-10 13:13:14', '2022-11-15 08:12:10'),
(33, NULL, 3, 'Home Certainty', 'EDC8A', 'https://www.insuranceapplication.com/cgi/webapp/mquotehc2.aspx?agentnumber=0000119009&company=110', 'Tier1', NULL, 'https://www.insuranceapplication.com/cgi/webapp/mobile/', '', NULL, '', '<p><strong>PLAN DESCRIPTION</strong></p>\r\n\r\n<p>Home Certainty&nbsp;is a simplified issue term to age 95 life insurance plan with 10, 15, 20, 25 and 30 year level premium periods. The premiums are guaranteed to remain level for the period selected.</p>\r\n\r\n<p><br />\r\n<strong>Issue Ages (age last birthday)</strong></p>\r\n\r\n<p>10 year level premium..................................... Ages 20 &ndash; 75<br />\r\n15 year level premium..................................... Ages 20 &ndash; 65</p>\r\n\r\n<p>20 year level premium..................................... Ages 20 &ndash; 60</p>\r\n\r\n<p>25 year level premium..................................... Ages 20 &ndash; 55</p>\r\n\r\n<p>30 year level premium..................................... Ages 20 &ndash; 50<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Minimum Face Amount</strong>&nbsp;&mdash; $25,000 face amount or $25.00 monthly premium (excluding riders),</p>\r\n\r\n<p>whichever is greater<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Maximum Face Amount</strong>&nbsp;&mdash; $250,000<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Benefits and Riders (not available in all states)</strong></p>\r\n\r\n<p>&bull; Return of Premium Rider</p>\r\n\r\n<p>&bull; Accelerated Living Benefit Rider (Critical Illness): Available at 25%, 50% or 100% acceleration of the death benefit (Up to $100,000 Critical Illness benefit)*</p>\r\n\r\n<p>&bull; Total Disability Benefit Rider (DIR): 60 day elimination, non-retroactive, monthly benefit 2% of face</p>\r\n\r\n<p>amount up to $1500 maximum monthly benefit</p>\r\n\r\n<p>&bull; Waiver of Premium*</p>\r\n\r\n<p>&bull; Children&rsquo;s Insurance Agreement</p>\r\n\r\n<p>&bull; Accidental Death Benefit</p>\r\n\r\n<p>&bull; Level Term Insurance Rider (available on Spouse only)</p>\r\n\r\n<p>&bull; Terminal Illness Accelerated Benefit Rider - available at no additional premium cost.</p>\r\n\r\n<p>&bull; Accelerated Benefits Rider-Confined Care - available at no additional premium cost.</p>\r\n\r\n<p>* Waiver of Premium cannot be issued on the same policy with the Critical Illness Rider.</p>\r\n\r\n<p>&nbsp;</p>', 'All', NULL, '2022-10-10 13:15:17', '2022-11-15 08:12:20'),
(34, NULL, 3, 'Dignity Solutions - Immediate', 'ACBD2', 'https://www.insuranceapplication.com/cgi/webapp/mquotefe2.aspx?s=50&pgm=6&agentnumber=0000119009&company=110', 'Tier1', NULL, 'https://www.americanamicable.com/CGI/SupplyReq/SupplyReqv2.exe', '', NULL, '', '<h1>Dignity Solutions</h1>\r\n\r\n<p><strong>Whole Life Insurance</strong><br />\r\n(Ages 50 through 85)&nbsp;<br />\r\n<br />\r\nThis product is especially good for smokers, insulin dependent diabetics, and those receiving disability. &nbsp;<br />\r\n<br />\r\n<strong>PLAN DESCRIPTIONS:</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Dignity Solutions &quot;Immediate Death Benefit&quot;:</strong>&nbsp;Simplified issue whole life policy with level death benefit of 100% of face amount paid immediately.</li>\r\n	<li><strong>Dignity Solutions &quot;Graded Death Benefit&quot;:</strong>&nbsp;Simplified issue whole life policy which pays 30% of selected face amount the 1st year, 70% paid the 2nd year and 100% paid the 3rd and subsequent years. 100% paid for accidental death, all years.&nbsp;</li>\r\n	<li><strong>Dignity Solutions &quot;Return of Premium Benefit&quot;:</strong>&nbsp;Simplified issue whole life policy which pays return of premium plus 10% interest for 3 years if under age 65, 2 years if age 65 or older. 100% paid after graded period. 100% paid for accidental death, all years.</li>\r\n</ul>\r\n\r\n<p><strong>TELEPHONE INTERVIEW</strong><br />\r\nA telephone interview conducted with the Proposed Insured is required on every application for the Immediate and Graded Death Benefit Plans prior to the policy being issued. After fully completing the application you may call from the client&rsquo;s home for the personal history telephone interview. The interview is designed to confirm the answers given on the application.<br />\r\n<br />\r\nThe interview can be completed in either of 2 ways:<br />\r\n1) at point-of-sale (recommended), or<br />\r\n2) the Company will contact the Proposed Insured upon receipt of the application.<br />\r\n<br />\r\nPoint-of-sale telephone interviews can be completed by calling one of the toll free numbers below. When calling be sure to identify yourself, Company and product being applied for &quot;Dignity Solutions&quot;. The applicant must always complete the telephone interview without assistance from the agent or another person. If the interview is completed at point-of-sale, mark the &quot;Telephone interview completed&quot; question &quot;Yes&quot; in the upper, right-hand corner of the application. If the sale is made outside of the vendor&#39;s hours of operation or if the interview is not completed at point-of-sale, mark this question &quot;NO&quot; and the Company will initiate the call upon receipt of the application.<br />\r\n<br />\r\nEMSI: 1-866-719-2024<br />\r\nEMSI (Spanish Line): 1-866-901-1776<br />\r\n8am-9pm Monday thru Friday CST<br />\r\n10am-2pm Saturdays CST</p>', 'All', NULL, '2022-10-10 13:17:24', '2022-11-15 08:12:48'),
(35, NULL, 10, 'Guaranteed Issue Whole Life', '2A55F', 'https://hq.quility.com/api/public/document/49217/view/aig-giwl-rate-card', 'Tier1', NULL, 'https://estationsecure.americangeneral.com/SharedFilePile/AG/AGLC110209_GIWL_SelfRegistration.pdf', '', NULL, '', '<p><strong>Guaranteed Issue Whole Life</strong><br />\r\nGIWL s a simple, affordable, benefit-packed product that will help you serve more clients in the final expense market.&nbsp;Older clients can be especially sensitive about burdening their loved ones with after-death expenses.<br />\r\n<br />\r\nIn addition to funeral expenses, there can be unpaid medical bills, credit card and loan balances, not to mention ongoing household expenses.<br />\r\n<br />\r\nGuaranteed Issue Whole Life (GIWL) is designed to provide these clients with comfort and peace-of-mind for just a few dollars a day. Plus, it includes benefits typically available only in more expensive policies.<br />\r\n<br />\r\nBest of all, acceptance is guaranteed. From application to policy issue, the process is simple, short and pain-free!<br />\r\n<br />\r\n<strong>Guaranteed issue permanent protection</strong><br />\r\n&bull;&nbsp;No health questions to answer<br />\r\n&bull;&nbsp;No medical tests<br />\r\n&bull;&nbsp;Guaranteed acceptance ages 50 to 80<br />\r\n&bull;&nbsp;Face amounts from $5,000 to $25,000 available<br />\r\n&bull; Required premium payments stop at or before age 90<br />\r\n<br />\r\n<strong>Graded Death Benefit Details</strong><br />\r\n&bull; Accidental Death:&nbsp;Full Face Amount<br />\r\n&bull; In the event of suicide:&nbsp;Premiums refunded&nbsp;<br />\r\n<br />\r\n<strong>Exclusions</strong></p>\r\n\r\n<ul>\r\n	<li>Product not approved for sale in NY &amp; ME.</li>\r\n	<li>All riders are not available in all states: Chronic Illness ABR not available in CA and DC, and Terminal Illness ABR not available in CA.</li>\r\n	<li>Unisex rates available in Montana only.</li>\r\n	<li>This product not available to foreign nationals</li>\r\n	<li>No benefit for accidental death is payable if the Insured&rsquo;s death is caused or contributed to by: disease or infirmity of mind or body, or medical or surgical treatment for such disease or infirmity; an infection not occurring as a direct result or consequence of an accidental bodily injury; any attempt at suicide, or intentional self-inflicted injury, while sane or insane; travel in an aircraft or device used for testing or experimental purposes, used by or for military authority or used for travel beyond the earth&rsquo;s atmosphere; active participation in a riot or insurrection; committing or attempting to commit a felony; intoxication as defined by the jurisdiction where the accidental injury occurred; riding or driving an air, land or water vehicle in a race, speed or endurance contest; rock or mountain climbing; bungee jumping; or aeronautics (hang-gliding, skydiving, parachuting, ultralight, soaring, ballooning and parasailing). No benefit for accidental death is payable if the Insured&rsquo;s death is caused or materially contributed to by: voluntary intake or use by any means of (a) any drug, unless prescribed or administered by a physician and taken in accordance with the physician&rsquo;s instructions, or (b) poison, gas or fumes, unless a direct result of an occupational accident; or participation in an illegal occupation or activity; or if death occurs while the Insured is incarcerated.&nbsp;</li>\r\n</ul>\r\n\r\n<p><br />\r\n&nbsp;</p>', 'All', NULL, '2022-10-10 13:19:11', '2022-11-15 08:14:17'),
